import './Gallerysection.css';

export default function Gallerysection (){

    return(
        <div className=' max-w-[1300px] w-auto m-auto mt-[120px]' >
            <div className="galleryText text-[150px]  " >
                GALLERY
            </div>
            <div>
                <img src="https://images.pexels.com/photos/268533/pexels-photo-268533.jpeg?cs=srgb&dl=pexels-pixabay-268533.jpg&fm=jpg" height='800px' />
            </div>
        </div>
    );

}
